import React from "react";
import { FaShoppingCart } from "react-icons/fa";

const Header = () => {
    return(
        <header style={styles.header}>
            <div style={styles.logo}>
                <img src="/logos.jpg" alt="logos" style={styles.logoImg} />

            </div>
            <input type="text" placeholder="Search for Products..." style={styles.searchBar}/>
            <nav style={styles.nav}>
                <a href="/">Shop by Category</a>
                <a href="/">Exotic Fruits</a>
                <a href="/">Fruits & Vegetables</a>
                <a href="/">Groceries</a>
                <a href="/">Beverages</a>
                
                <button style={styles.login}>Login /Sign Up</button>
                <FaShoppingCart size={20} color="black" style={{marginLeft:"auto"}}/>

            </nav>
        </header>
    );
};
 const styles ={
    header:{display:"flex",justifyContent:"space-between",alignItems:"center",padding:"10px",background:"#f5f5f5"},
    logoImg:{width:"100px"},
    searchBar:{flex:1,margin:"0,10px",padding:"8px",border:"1px solid #ccc", borderRadius:"4px"},
    nav:{display:"flex",gap:"15px",alignItems:"center"},
    login:{background:"#000",color:"#fff",padding:"5px 10px",borderRadius:"5px"},
   


 };




export default Header;
